import Home from './Home';
import './File.css';

class Form extends React.Component {
	render() {
  	return (
    	<form>
      <span className="formtext"> Form </span>
    	  <input type="text" placeholder="Enter Name" required />
        <button> Create </button>
      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
          </tr>
        </tbody>
      </Table>
    	</form>
    );
  }
}

export default Form;
